けいそうリフォーム基材　壁用　主成分:珪藻土、砂、パルプ　正味質量:3,800g(SKセレクトカラー200g含む)　使用方法:調合/壁材(粉末合成樹脂混合)、着色剤　標準加水量/2.0リットル/袋(吹付け時:2.5リットル/袋)　標準所要量:3,800g/3.3平方メートル、(吹付け時:平方メートル、)(SKセレクトカラー含む)　1.2～1.5mm(模様付けの種類により異なる)　「吹付け施工」「鏝塗り施工」とも2度吹き・2度塗りを標準とします。　共剤で下ごすりを行い、表面乾燥後に上塗りをします。　
      <P><FONT color="#ff0000">※施工には基材とセレクトカラーが必要です。　<BR>
        けいそうリフォーム基材(壁用・天井用)1袋に対してセレクトカラー1本を使用します。</FONT></P><style type="text/css">
